import React from 'react';
import './ImageLinkForm.css'

const ImageLinkForm =({onInputChange}) =>{
    return(
        <div>
            <p className="f3">
                {"This Magic Brain will detect faces in your pictures."}
            </p>
            <div className="center">
                <div className="form center pa4 br3 shadow-5" style={{background: '#4cb28f3b'}}>
                <input className="ma2 f4 pa2 w-70 center" type="text" onChange={onInputChange}/>
                <button className="ma2 w-20 grow f4 link ph3 pv2 dib white bg-light-purple">Detect</button>
            </div>
            </div>
        </div>
    );
}

export default ImageLinkForm;
